;(function() {
    let myMap;

    const init = () => {
        myMap = new ymaps.Map("map", {
        center: [59.112518, 37.935135],
        zoom: 13,
        controls: []
        });

        const coords = [
        [59.132231 ,37.933373],
        [59.094138, 37.924574],
        [59.119801, 38.000195],
        ];

        const myCollection = new ymaps.GeoObjectCollection({}, {
        draggable: false,
        iconLayout: 'default#image',
        iconImageHref: './img/icons/marker.svg',
        iconImageSize: [46, 57],
        iconImageOffset: [-35, -52]
        });

        coords.forEach(coord => {
        myCollection.add(new ymaps.Placemark(coord));
        });

        myMap.geoObjects.add(myCollection);
        myMap.behaviors.disable('scrollZoom');
    };

    ymaps.ready(init);
})()
;(function() {
  const validateFields = (form, fieldsArray) => {
    fieldsArray.forEach(field => {
      field.removeClass('form__input--error');
      if (field.val().trim() == "") {
        field.addClass('form__input--error')
      }
    });
  
    const errorField = form.find('.form__input--error');
  
    return errorField.length == 0;
  };
  
  $('.form').submit(e => {
    e.preventDefault();
  
    const form = $(e.currentTarget);
    const name = form.find("[name='name']");
    const phone = form.find("[name='phone']");
    const comment = form.find("[name='comment']");
    const to = form.find("[name='to']");
  
    const modal = $('#modal');
    const content = modal.find('.modal__content');
  
    modal.removeClass('error-modal');
  
    const isValid = validateFields(form, [name, phone, comment, to]);
  
    if (isValid) {
     const request = $.ajax({
        url: "https://webdev-api.loftschool.com/sendmail",
        method: "post",
        data: {
          name: name.val(),
          phone: phone.val(),
          comment: comment.val(),
          to: to.val()
        }
      });
  
      request.done(data => {
        // console.log(data);
        content.text(data.message);
      });
  
      request.fail(data => {
        //console.log(data);
        const meassage = data.responseJSON.meassage;
        content.text(meassage);
        modal.addClass('error-modal');
      });
  
      request.always(() => {
        $.fancybox.open({
          src: "#modal",
          type: "inline"
        });
      });
    };
  });
  
  $('.app-submit-btn').on('click', e => {
    e.preventDefault();
  
    $.fancybox.close();
  });
})()
;(function () {
    const sections = $('section');
    const display = $('.maincontent');
    const sideMenu = $('.fixed-menu');
    const menuItems = $('.fixed-menu__item');

    const mobileDetect = new MobileDetect(window.navigator.userAgent);
    const isMobile = mobileDetect.mobile();

    let inScroll = false;

    const countSectionPosition = sectionEq => {
        const position = sectionEq * -100;

        if (isNaN(position)) {
            console.error('передано неверное значение countSectionPosition');
            return 0;
        };

        return position;
    };

    const changeMenuThemeForSection = sectionEq => {
        const currentSection = sections.eq(sectionEq);
        const menuTheme = currentSection.attr('data-sidemenu-theme');
        const activeClass = 'fixed-menu--shadowed';

        if (menuTheme === 'black') {
            sideMenu.addClass(activeClass);
        } else {
            sideMenu.removeClass(activeClass);
        };
    };

    const resetActiveClassForItem = (items, itemEq, activeClass) => {
        items.eq(itemEq).addClass(activeClass).siblings().removeClass(activeClass);
    };

    const performTransition = sectionEq => {

        if (inScroll) return;

        const transitionOver = 1000;
        const mousInertiaOver = 300; 

        inScroll = true;

        const position = countSectionPosition(sectionEq);

        changeMenuThemeForSection(sectionEq);

        display.css({
            transform: `translateY(${position}%)`
        });
        
        resetActiveClassForItem(sections, sectionEq, 'section--active');

        resetActiveClassForItem(menuItems, sectionEq, 'fixed-menu__item--active');

        setTimeout(() => {
            inScroll = false;
        }, transitionOver + mousInertiaOver);
    };

    sections.first().addClass('section--active');

    const viewportScroller = () => {
        const activeSection = sections.filter('.section--active');
        const nextSection = activeSection.next();
        const prevSection = activeSection.prev();

        return {
            next() {
                if (nextSection.length) {
                    performTransition(nextSection.index())
                };
            },
            prev() {
                if (prevSection.length) {
                    performTransition(prevSection.index())
                };
            }
        };
    };

    $(window).on('wheel', e => {
        const deltaY = e.originalEvent.deltaY;
        const scroller = viewportScroller();

        if (deltaY > 0) {
            scroller.next();
        };

        if (deltaY < 0) {
           scroller.prev();
        }; 
    });

    $(window).on('keydown', e=> {
        const tagName = e.target.tagName.toLowerCase(); //убрать скролл на полях ввода
        const userTypingInInputs = tagName === 'input' || tagName === 'textarea';
        const scroller = viewportScroller();

        if (userTypingInInputs) return; 

        switch (e.keyCode) {
            case 38: //prev
                scroller.prev();
                break;
            case 40: //next
                scroller.next();
                break;
        };   
    });

    $('.wrapper').on('touchmove', e => {
        e.preventDefault();
    });

    $('[data-scroll-to]').on('click', e=> {
        e.preventDefault();

        const $this = $(e.currentTarget);
        const target = $this.attr('data-scroll-to');
        const reqSection = $(`[data-section-id=${target}]`);

        const fMenu = document.querySelector('.fullscreen-menu');
        fMenu.style.top = "-100%";
        fMenu.style.opacity = 0;

        performTransition(reqSection.index());
    });

    if (isMobile) {
        //https://github.com/mattbryson/TouchSwipe-Jquery-Plugin
        $("body").swipe( {
            swipe: function (
                event, 
                direction, 
            ) {
                const scroller = viewportScroller();
                let scrollDirection = "";

                if (direction === 'up') scrollDirection = 'next';
                if (direction === 'down') scrollDirection = 'prev';

                scroller[scrollDirection]();
            }
        });
    }


    
})()

